  `Header` text CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL,
  `Query` text CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL,
  `CreateBy` varchar(50) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `CreateDate` timestamp NULL DEFAULT current_timestamp,
  `Nama` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of masterreport
-- ----------------------------
INSERT INTO `masterreport` VALUES ('MR-2302220001', 'IdPelanggan, NamaPelanggan, NamaSales, JenisBayar, JatuhTempo, Invoice, NameProduct, Jml, Harga, Disc, SubTotal, StatusClose, CloseBy', 'SELECT mp.Id IdPelanggan, mp.NamaPelanggan, me.Username NamaSales, mjb.JenisBayar, so.JatuhTempo, so.Invoice, \r\n	msp.NameProduct, dso.Jml, dso.Harga, dso.Disc, so.Pph, dso.SubTotal,\r\n	so.CreateDate, CASE IFNULL(so.IsClose,\'\') WHEN \'\' THEN \'Belum Close\' ELSE \'Sudah Close\' END StatusClose,\r\n	mee.Username CloseBy\r\nFROM masterso AS so\r\nLEFT JOIN masterpelanggan AS mp ON mp.Id = so.IdPelanggan\r\nLEFT JOIN masteremploye AS me ON me.Id = so.IdSales\r\nLEFT JOIN masterjenisbayar AS mjb ON mjb.Id = so.MetodeBayar\r\nLEFT JOIN masteremploye AS mee ON mee.Id = so.CreateCloseBy\r\nLEFT JOIN detailso AS dso ON dso.IdSo = so.Id\r\nLEFT JOIN masterproduct AS msp ON msp.Id = dso.IdProduct\r\nWHERE IFNULL(so.StatusBatal,\'\') = \'\' AND IFNULL(so.ApproveDate,\'\') != \'\'\r\n	AND IFNULL(so.Invoice,\'\') != \'\' AND CONVERT(so.TglInvoice, DATE) BETWEEN \r\n		CASE IFNULL(\'2023-01-01\', \'\') WHEN \'\' THEN CURRENT_DATE() \r\n			ELSE \'2023-01-01\' END \r\n	AND CASE IFNULL(\'2023-02-22\', \'\') WHEN \'\' THEN CURRENT_DATE()\r\n			ELSE \'2023-02-22\' END\r\n	AND me.Username LIKE \'%%\'\r\n	AND mp.NamaPelanggan LIKE \'%%\'\r\n	AND IFNULL(msp.ApproveBy, \'\') != \'\' AND msp.Status = \'1\'\r\n	AND msp.NameProduct LIKE \'%%\'', 'admin', '2023-02-22 13:40:18', 'Report Detail Toko');

