-- ----------------------------
-- Procedure structure for whileCount
-- ----------------------------
DROP PROCEDURE IF EXISTS `whileCount`;
delimiter ;;
CREATE PROCEDURE `whileCount`()
WHOLEBLOCK:BEGIN
  declare x INT default 1;
	SET @countId = (SELECT COUNT(IFNULL(KodeSJ, 0)) FROM detailso WHERE KodeSJ = 'SJ-2307210002'); 
  WHILE x <= @countId DO
    INSERT INTO tempCount(IdCount) VALUES(x);
    SET x = x + 1;
  END WHILE;
END
;;
delimiter ;

