-- Procedure structure for while_example
-- ----------------------------
DROP PROCEDURE IF EXISTS `while_example`;
delimiter ;;
CREATE PROCEDURE `while_example`()
wholeblock:BEGIN
  declare x INT default 1;
  SET x = 1;
	SET @countId = (SELECT COUNT(IFNULL(KodeSJ, 0)) FROM detailso WHERE KodeSJ = 'SJ-2307210002'); 

  WHILE x <= @countId DO
    INSERT INTO tempCount(IdCount) VALUES(x);
    SET x = x + 1;
  END WHILE;

  select * FROM tempCount;
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
